n = int(""[::-1],16)
c = int(""[::-1],16)
d = int(""[::-1],16)

def flip(d):
    res = "0b"
    for i in bin(d)[2:]:
        if i == '1':
            res += "0"
        else:
            res += "1"
    return int(res,2)

d = flip(d)
m = pow(c,d,n)
print(bytes.fromhex(hex(m)[2:]))
